// app/dashboardAdmin/page.tsx
"use client";

import { Card, CardContent } from "@/components/ui/card";
import { Button } from "@/components/ui/button";
import { useState, useEffect } from "react";
import jsPDF from "jspdf";
import { UserRoundCheck, UsersRound, FileCheck2, UserCheck2, Newspaper } from "lucide-react";
import axios from "axios";
import "jspdf-autotable"; // Para tablas (si quieres incluir tablas también)
import Chart from "chart.js/auto"; // Para gráficas
import html2canvas from "html2canvas"; 

const DashboardAdminPage = () => {
  const [stats, setStats] = useState({
    totalUsers: 0,
    totalSnippets: 0,
    totalPublicaciones: 0,
    totalComentarios: 0,
    snippetsAprobados: 0,
    usuariosActivos: 0,
  });
  const [user, setUser] = useState<{ username: string} | null>(null);

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      console.error("Token no encontrado");
      return;
    }
    const fetchUserName = async () => {
      try {
        const response = await fetch("http://localhost:8000/users/me", {
          method: "GET",
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
    
        if (!response.ok) {
          const error = await response.text();
          throw new Error(error);
        }
    
        const data = await response.json();
    
        setUser({
          username: data.username || "Username",
        });
        
    
      } catch (error) {
        console.error('Error al cargar el nombre de usuario:', error);
      }
    };
    
    const fetchStats = async () => {
      try {
        const response = await fetch("api/admin/informe", {
          method: "GET",
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
  
        if (!response.ok) {
          const error = await response.text();
          throw new Error(error);
        }
  
        const data = await response.json();
  
        setStats(prevStats => ({
          ...prevStats,
          totalUsers: data.total_usuarios,
          totalSnippets: data.total_snippets,
          totalPublicaciones: data.total_publicaciones,
          totalComentarios: data.total_comentarios,
          snippetsAprobados: data.snippets_aprobados,
          usuariosActivos: data.usuarios_activos,
        }));
  
      } catch (error) {
        console.error('Error al cargar estadísticas:', error);
      }
    };
    fetchUserName();
    fetchStats();
  }, []);
  
// Para renderizar el canvas en imagen
const handleDownloadPDFReport = () => {
  const doc = new jsPDF();

  const pageWidth = doc.internal.pageSize.getWidth();
  const margin = 20;
  let y = 40; // Comienza un poco más abajo para no chocar con el header

  // --- HEADER ---
  // Espacio para logo (opcional, puedes agregar el addImage aquí si tienes el logo)
  doc.addImage(
    "data:image/png;base64,",
    "SVG", // tipo de imagen
    20, 10, // x, y
    30, 15 // width, height
  );
  
  // Título
  doc.setFont("helvetica", "bold");
  doc.setFontSize(22);
  doc.setTextColor(30, 30, 30);
  doc.text("Reporte de Estadísticas", margin + 40, 20); // desplazado por si pones un logo

  // Línea decorativa
  doc.setDrawColor(100);
  doc.setLineWidth(0.5);
  doc.line(margin, 30, pageWidth - margin, 30);

  // --- BODY ---
  doc.setFontSize(12);

  const statsList = [
    { label: "Usuarios Registrados", value: stats.totalUsers },
    { label: "Snippets Creados", value: stats.totalSnippets },
    { label: "Publicaciones Totales", value: stats.totalPublicaciones },
    { label: "Comentarios Totales", value: stats.totalComentarios },
    { label: "Snippets Aprobados", value: stats.snippetsAprobados },
    { label: "Usuarios Activos", value: stats.usuariosActivos },
  ];

  statsList.forEach((stat) => {
    // Fondo para cada estadística
    doc.setFillColor(240, 248, 255); // azul muy clarito (alice blue)
    doc.roundedRect(margin, y - 5, pageWidth - margin * 2, 12, 3, 3, 'F');

    // Texto
    doc.setTextColor(60, 60, 60);
    doc.setFont("helvetica", "bold");
    doc.text(`${stat.label}:`, margin + 5, y + 3);

    doc.setFont("helvetica", "normal");
    doc.text(`${stat.value}`, pageWidth / 2, y + 3);

    y += 20; // Espaciado
  });

  // --- FOOTER ---
  const fecha = new Date().toLocaleDateString();
  doc.setFontSize(10);
  doc.setTextColor(150);
  doc.setFont("helvetica", "italic");
  doc.text(`Generado el: ${fecha}`, margin, 285); // casi al pie

  doc.text(`Página 1`, pageWidth - margin - 20, 285);

  // Guardar PDF
  doc.save("reporte_estadisticas.pdf");
};


 

  const DashboardHeader = ({ nombre }: { nombre: string }) => (
    <div className="bg-muted/40 p-6 rounded-md shadow-sm mb-8">
      <h1 className="text-3xl font-bold mb-2">Dashboard Administrativo</h1>
      <p className="text-lg text-muted-foreground">
        Bienvenido, {nombre}.
      </p>
    </div>
  );
  

  const StatCard = ({ title, value, Icon }) => (
    <Card>
      <CardContent className="p-6 flex justify-center items-center flex-col">
        <h2 className="mb-6 text-center text-2xl font-bold">{title}</h2>
        <Icon className="mb-6 h-20 w-20 text-muted-foreground" />
        <p className="text-2xl font-bold">{value}</p>
      </CardContent>
    </Card>
  );

  return (
    <div className="p-6">
      <DashboardHeader nombre={user?.username || ""} />
      <section className="border-t bg-muted/40 py-16">
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mb-6">

          <StatCard title="Usuarios Registrados" value={stats.totalUsers} Icon={UsersRound} />
          <StatCard title="Snippets Creados" value={stats.totalSnippets} Icon={FileCheck2} />
          <StatCard title="Publicaciones Totales" value={stats.totalPublicaciones} Icon={Newspaper} />
          <StatCard title="Comentarios Totales" value={stats.totalComentarios} Icon={UserRoundCheck} />
          <StatCard title="Snippets Aprobados" value={stats.snippetsAprobados} Icon={FileCheck2} />
          <StatCard title="Usuarios Activos" value={stats.usuariosActivos} Icon={UserCheck2} />

        </div>

        <div className="flex justify-center items-center flex-col mb-10">
          <Button onClick={handleDownloadPDFReport}>Descargar Reporte en PDF</Button>
        </div>
      </section>
    </div>
  );
};

export default DashboardAdminPage;
